/**
 * @param {number} m
 * @param {number} n
 * @param {number[]} horizontalCut
 * @param {number[]} verticalCut
 * @return {number}
 */

// Always cut most expensive first
var minimumCost = function(m, n, horizontalCut, verticalCut) {
  let cuts = [];
  for (let i = 0; i < m - 1; i++) {
    cuts.push(['H', i, horizontalCut[i]]);
  }
  for (let i = 0; i < n - 1; i++) {
    cuts.push(['V', i, verticalCut[i]]);
  }
  cuts.sort((a, b) => b[2] - a[2]);
  let vertCount = 1, horiCount = 1;
  let cost = 0;
  for (let [cut, _cutIndex, cutCost] of cuts) {
    if (cut === 'H') {
      cost += (cutCost * vertCount);
      horiCount++;
    } else {
      cost += (cutCost * horiCount);
      vertCount++;
    }
  }
  return cost;
};
